#include <fuzzer/FuzzedDataProvider.h>

#include <aconf.h>
#include <stddef.h>
#include <stdint.h>

#include "GString.h"
#include "GlobalParams.h"
#include "PDFDoc.h"
#include "config.h"

extern "C" int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  FuzzedDataProvider fdp(data, size);

  double forHdti = fdp.ConsumeFloatingPointInRange<double>(0.0, 2500.0);
  double forVdtpi = fdp.ConsumeFloatingPointInRange<double>(0.0, 2500.0);
  int rotation = fdp.ConsumeIntegralInRange<int>(-360, 360);
  GBool useCropBox = fdp.ConsumeIntegral<GBool>();
  GBool cropForDisplay = fdp.ConsumeIntegral<GBool>();
  GBool printing = fdp.ConsumeIntegral<GBool>();
  int fromPageNum = fdp.ConsumeIntegralInRange<int>(0, 2500);
  int toPageNum = fdp.ConsumeIntegralInRange<int>(fromPageNum, 2500);

  std::vector<char> buf = fdp.ConsumeRemainingBytes<char>();

  globalParams = new GlobalParams("/usr/local/etc/xpdfrc");
  globalParams->setupBaseFonts("/usr/share/ghostscript/9.25/Resource/cidfmap");

  Object obj;
  obj.initNull();
  MemStream *str = new MemStream(buf.data(), 0, buf.size(), &obj);

  PDFDoc *doc = new PDFDoc(str, NULL, NULL, NULL);

  if (doc->isOk()) {
    doc->displayPages(NULL, fromPageNum, toPageNum, forHdti, forVdtpi, rotation, useCropBox, cropForDisplay, printing, NULL, NULL);
  }

  delete doc;
  delete globalParams;

  return 0; // Add this line to fix the error
}

#include <fuzzer/FuzzedDataProvider.h>

#include <stddef.h>
#include <stdint.h>
#include <vector>

#include "GString.h"
#include "GlobalParams.h"
#include "PDFDoc.h"
#include "config.h"

extern "C" int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  FuzzedDataProvider fdp(data, size);

  double hDPI = fdp.ConsumeFloatingPoint<double>();
  double vDPI = fdp.ConsumeFloatingPoint<double>();
  int rotate = fdp.ConsumeIntegral<int>();
  GBool useMediaBox = fdp.ConsumeBool();
  GBool crop = fdp.ConsumeBool();
  GBool printing = fdp.ConsumeBool();
  std::vector<char> buf = fdp.ConsumeRemainingBytes<char>();

  globalParams = new GlobalParams("/usr/local/etc/xpdfrc");
  globalParams->setupBaseFonts("/usr/share/ghostscript/9.25/Resource/cidfmap");

  Object obj;
  obj.initNull();
  MemStream *str = new MemStream(buf.data(), 0, buf.size(), &obj);
  PDFDoc *doc = new PDFDoc(str, NULL, NULL, NULL);

  if (doc->isOk()) {
    doc->displayPages(NULL, 1, 1, hDPI, vDPI, rotate, useMediaBox, crop, printing, NULL, NULL);
  }

  delete doc;
  delete globalParams;

  return 0;
}
